var loadCloadTexture2 = function(cloudTexture) {
	var cloudTextureText2 = "data:image/png;base64,";
	var texture2Loaded = false;
	var cloudImage2 = new Image();
	cloudImage2.onload = function() {
		console.info("Cloud image 2 loaded !");
		var cloudTexture2 = new THREE.Texture(cloudImage2);
		cloudTexture2.needsUpdate = true;
		texture2Loaded = true;
		Game.main.addClouds(cloudTexture, cloudTexture2);
	}
	cloudImage2.onerror = function() {
		console.error("Cannot load cloud image 2");
		// do something else...
	}
	cloudImage2.src = cloudTextureText2;
}